import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <span className="iconify" data-icon="ri:customer-service-2-fill"></span>
      <span className="iconify" data-icon="ic:twotone-design-services"></span>
      <span className="iconify" data-icon="ep:back"></span>
      <span className="iconify" data-icon="ep:forward"></span>
    </div>
  );
}

export default App;
